import React from "react";
impo

const Topsocialicons = () => {
    return (
        <div className="top-social-icons-container">

        <div className="top-icons">
                <a aria-label="My Linkedin Profile" target="_blank" href="https://www.linkedin.com/in/sanchezdiezma/"/>
                    <i class="icon fa fa-linkedin" aria-hidden="true"></i>
        </div>

        <div className="top-icons">
                <i class="devicon-github-original"></i>
        </div>

        <div className="top-icons">
                <i class="devicon-behance-plain"></i>
        </div>

        </div>
    )
}

export default Topsocialicons;
